import {
  init_esm_shims
} from "./chunk-WWCIODDN.js";

// Modals/CustomEmbed/ce_image.ts
init_esm_shims();
var ce_image_default = {
  id: "ce_image",
  async execute(interaction) {
    const url = interaction.fields.getTextInputValue("url");
    const embed = interaction.message.embeds[0];
    embed.data.image = {
      url
    };
    interaction.reply({ content: "Das Bild wurde erfolgreich ge\xE4ndert", ephemeral: true });
    await interaction.message.edit({ embeds: [embed] });
  }
};
export {
  ce_image_default as default
};
